import React, { useState } from "react";
import { styled, alpha } from '@mui/material/styles';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import InputBase from '@mui/material/InputBase';
import Badge from '@mui/material/Badge';
import MenuItem from '@mui/material/MenuItem';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';
import MailIcon from '@mui/icons-material/Mail';
import NotificationsIcon from '@mui/icons-material/Notifications';
import MoreIcon from '@mui/icons-material/MoreVert';
import "./style.css";

export default function Invoice() {

  const [data, setData] = useState([]);


  const [compName, setCompName] = useState("");
  const [compAddress, setCompAddress] = useState("");
  const [compNumber, setCompNumber] = useState("");
  const [compinvoiceId, setInvoiceID] = useState("");
  const [compInvoiceDate, setCompInvoiceDate] = useState("");
  const [customerName, setCustomerName] = useState("");
  const [customerAddress, setCustomerAddress] = useState("");
  const [customerNumber, setCustomerNumber] = useState("");
  const [customerEmail, setCustomerEmail] = useState("");
  const [compdueDate, setDueDate] = useState("");
  const [paymentDate, setPaymentDate] = useState("");
  const [tableProductDate, setTableProductDate] = useState("");
  const [Description, setDescription] = useState("");
  const [quntity, setQuntity] = useState("");
  const [rate, setRate] = useState("");
  const [amount, setAmounts] = useState("");
  const [tax, setTax] = useState("");
  const [taxAmount, setTaxAmount] = useState("");
  const [totalAmount, setTotalAmount] = useState("");
  const [tablePaymentId, setTablePaymentId] = useState("");
  const [tableBankName, setTableBankName] = useState("");
  const [tableAccNumber, setTableAccNumber] = useState("");
  const [tableifscCode, setTableifscCode] = useState("");

  const handelevent = async (e) => {
    e.preventDefault();
    await fetch(
    'http://localhost:5000/invoice', {
        method: "get"
    })
    .then((res) => res.json())
    .then((da) => {
      
      setData(da);
      setData(da);
      da.map(i => {
        setCompName(i.compName);
        setCompAddress(i.compAddress);
        setCompNumber(i.compNumber);
        setInvoiceID(i._id);
        setCompInvoiceDate(i.compInvoiceDate);
        setCustomerName(i.customerName);
        setCustomerAddress(i.customerAddress);
        setCustomerNumber(i.customerNumber);
        setCustomerEmail(i.customerEmail);
        setDueDate(i.compdueDate);
        setPaymentDate(i.paymentDate);
        setTableProductDate(i.tableProductDate);
        setDescription(i.Description);
        setQuntity(i.quntity);
        setRate(i.rate);
        setAmounts(i.amount);
        setTax(i.tax);
        setTaxAmount(i.taxamount);
        setTotalAmount(i.totalAmount);
        setTablePaymentId(i.tablePaymentId);
        setTableBankName(i.tableBankName);
        setTableAccNumber(i.tableAccNumber);
        setTableifscCode(i.tableifscCode);


      })
      console.log(data);
      console.log(data[0]);
      console.log(compName,compAddress);
    })
  }





  const [anchorEl, setAnchorEl] = React.useState(null);
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = React.useState(null);

  const isMenuOpen = Boolean(anchorEl);
  const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

  const handleProfileMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMobileMenuClose = () => {
    setMobileMoreAnchorEl(null);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    handleMobileMenuClose();
  };

  const handleMobileMenuOpen = (event) => {
    setMobileMoreAnchorEl(event.currentTarget);
  };

  const menuId = 'primary-search-account-menu';
  const renderMenu = (
    <Menu
      anchorEl={anchorEl}
      anchorOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      id={menuId}
      keepMounted
      transformOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      open={isMenuOpen}
      onClose={handleMenuClose}
    >
      <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
      <MenuItem onClick={handleMenuClose}>My account</MenuItem>
    </Menu>
  );

  const mobileMenuId = 'primary-search-account-menu-mobile';
  const renderMobileMenu = (
    <Menu
      anchorEl={mobileMoreAnchorEl}
      anchorOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      id={mobileMenuId}
      keepMounted
      transformOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      open={isMobileMenuOpen}
      onClose={handleMobileMenuClose}
    >
      <MenuItem>
        <IconButton size="large" aria-label="show 4 new mails" color="inherit">
          <Badge badgeContent={4} color="error">
            <MailIcon />
          </Badge>
        </IconButton>
        <p>Messages</p>
      </MenuItem>
      <MenuItem>
        <IconButton
          size="large"
          aria-label="show 17 new notifications"
          color="inherit"
        >
          <Badge badgeContent={17} color="error">
            <NotificationsIcon />
          </Badge>
        </IconButton>
        <p>Notifications</p>
      </MenuItem>
      <MenuItem onClick={handleProfileMenuOpen}>
        <IconButton
          size="large"
          aria-label="account of current user"
          aria-controls="primary-search-account-menu"
          aria-haspopup="true"
          color="inherit"
        >
          <AccountCircle />
        </IconButton>
        <p>Profile</p>
      </MenuItem>
    </Menu>
  );


  return (
    <div>
      <div className="page">
        <div className="HeaderDiv">
          <div className="column">
            <img
              src="https://sourceit.com.ua/images/courses/react.png?111"
              className="ImageLogo"
            ></img>
            <div className="CompanyDetails">
              <h4 name="companyName">[{compName}]</h4>
              <h4 name="companyAddress">[{compAddress}]</h4>
              <h4 name="companyNumber">[{compNumber}]</h4>
              <h4 name="website">
                <a href="https://qliclabs.com/">[qliclabs.com]</a>
              </h4>
            </div>
            <div className="CustomerDetails">
              <h4>Invoice to:</h4>
              <h4>[{customerName}]</h4>
              <h4>[{customerAddress}]</h4>
              <h4>[{customerNumber}]</h4>
              <h4>[{customerEmail}]</h4>
            </div>
          </div>
          <div className="column">
            <h1 className="InvoceHeading">TAX INVOICE</h1>
            <div>
              <div className="InvoiceColumn1">
                <h5>Invoice #</h5>
                <h4>{compinvoiceId}</h4>
                <h5 className="duedate">Due Date</h5>
                <h4>[{compdueDate}]</h4>
              </div>
              <div className="InvoiceColumn2">
                <h5>Invoice Date</h5>
                <h4>{compInvoiceDate}</h4>
                <h5 className="duedate">PaymentDate</h5>
                <h4>[{paymentDate}]</h4>
              </div>
            </div>
          </div>
        </div>
        <table className="table" id="customers">
          <thead>
            <tr>
              <th>Date</th>
              <th>Description</th>
              <th>Qty/Hrs</th>
              <th>Rate</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{tableProductDate}</td>
              <td>{Description}</td>
              <td>{quntity}</td>
              <td>{rate}</td>
              <td>{amount}</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>
          </tbody>
        </table>
        <div>
          <div className="footermainDiv">
            <div className="FooterSubDiv1">
              <h5>Payment Methods:</h5>
              <h4 className="paymentDetails">[{tablePaymentId}]</h4>
              <h4>We accept Visa Master Card, etc</h4>
              <h5 className="bankDetails">Bank Details:</h5>
              <h4>[{tableBankName}]</h4>
              <h4>[{tableAccNumber}]</h4>
              <h4>[{tableifscCode}]</h4>
            </div>
            <div className="FooterSubDiv2">
              <table id="totals">
                <tr>
                  <td>Subtotal</td>
                  <td>{amount}</td>
                </tr>
                <tr>
                  <td>Tax @ {tax}%</td>
                  <td>{taxAmount}</td>
                </tr>
                <tr>
                  <td>Others</td>
                  <td></td>
                </tr>
                <tr>
                  <th>Total</th>
                  <th>{totalAmount}</th>
                </tr>
              </table>
            </div>
          </div>
          <div className="thankyoudiv">
            <h3>Thank You For Your Business!</h3>
          </div>
        </div>
      </div>
      <div className="footerPage">
      <Box sx={{ flexGrow: 1 }}>
      <AppBar>
        <Toolbar>
         
          <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Search…"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>
          <Box sx={{ flexGrow: 1 }} />
          <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
            <IconButton size="large" aria-label="show 4 new mails" color="inherit">
              <Badge badgeContent={4} color="error">
                <MailIcon />
              </Badge>
            </IconButton>
            <IconButton
              size="large"
              aria-label="show 17 new notifications"
              color="inherit"
            >
              <Badge badgeContent={17} color="error">
                <NotificationsIcon />
              </Badge>
            </IconButton>
            <IconButton
              size="large"
              edge="end"
              aria-label="account of current user"
              aria-controls={menuId}
              aria-haspopup="true"
              onClick={handleProfileMenuOpen}
              color="inherit"
            >
              <AccountCircle />
            </IconButton>
          </Box>
          <Box sx={{ display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size="large"
              aria-label="show more"
              aria-controls={mobileMenuId}
              aria-haspopup="true"
              onClick={handleMobileMenuOpen}
              color="inherit"
            >
              <MoreIcon />
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>
    </Box>
        <button onClick={handelevent} style={{display:"block", backgroundColor:"blue"}}>search</button>
      </div>
    </div>
  );
}



const Search = styled('div')(({ theme }) => ({
  position: 'relative',
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.white, 0.15),
  '&:hover': {
    backgroundColor: alpha(theme.palette.common.white, 0.25),
  },
  marginRight: theme.spacing(2),
  marginLeft: 0,
  width: '100%',
  [theme.breakpoints.up('sm')]: {
    marginLeft: theme.spacing(3),
    width: 'auto',
  },
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: 'inherit',
  '& .MuiInputBase-input': {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('md')]: {
      width: '20ch',
    },
  },
}));
